import './Profile.css';
import Image from "./Image/Image";
import ProfileCard from "./ProfileCard/ProfileCard";
import Posts from "./Posts/Posts";

const Profile = (props) => {
	return (
		<div className='profile'>
			<Image/>
			<ProfileCard/>
			<Posts posts_data={ props.posts_data }/>
		</div>
	)
}

export default Profile;
